import "./posts.css";
import React from "react";

const Posts = (props) => {
  function openComents(e) {
    e.preventDefault();
    window.location = "/public/coments.html";
  }
  return (
    <div className="post">
      <h2 className="post-title">{props.post.title}</h2>
      <span className="post-body">{props.post.body}</span>
      <button className="post-btn" onClick={openComents}>
        Coments
      </button>
    </div>
  );
};

export default Posts;
